pragma solidity ^0.5.16;

//import "./AccessRestriction.sol";
//import "./StringUtils.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

contract SharedWallet {
  using SafeMath for uint256;
  mapping(address => uint256) deposited;
  mapping(address => uint256) withdrawn;
  mapping(address => uint256) stake;
  address[] accounts;
  uint256 constant stakeDecimals = 2;
  uint256 totalDeposited = 0;
  uint256 totalWithdrawn = 0;

  function getWalletBalance() public view returns (uint256) {
    return address(this).balance;
  }

  function() external payable {
    if (msg.value > 0) {
      if (deposited[msg.sender] == 0) {
        accounts.push(msg.sender);
      }
      deposited[msg.sender] = deposited[msg.sender].add(msg.value);
      totalDeposited = totalDeposited.add(msg.value);
      calibrateStake(msg.sender);
    }
  }

  function calibrateStake(address _account) internal {
    uint256 totalBalance = getAvailableBalanceFor(_account).mul(
      10**stakeDecimals
    );
    uint256 accountContributed;
    uint256 totalContributed;

    //TOTAL:
    if (totalWithdrawn > totalDeposited) {
      totalContributed = 0;
    } else {
      totalContributed = totalDeposited.sub(totalWithdrawn);
    }
    //ACCOUNT:
    if (withdrawn[_account] > deposited[_account]) {
      accountContributed = 0;
    } else {
      accountContributed = deposited[_account].sub(withdrawn[_account]);
    }
    stake[_account] = accountContributed.mul(10**stakeDecimals).div(
      totalContributed
    );
  }

  function getAvailableBalance() public view returns (uint256) {
    return getWalletBalance().mul(stake[msg.sender]).div(10**stakeDecimals);
  }

  function getAvailableBalanceFor(address _account)
    public
    view
    returns (uint256)
  {
    return getWalletBalance().mul(stake[_account]).div(10**stakeDecimals);
  }

  function getStakes() public returns (uint256[] memory) {
    //uint size = accounts.length;
    uint256[] memory result;
    for (uint256 i = 0; i < accounts.length; i++) {
      result[i] = stake[accounts[i]];
    }
    return result;
  }
}
